def makeDict(s: str) -> dict:
	out_dict = {}
	for c in s:
		if not c in out_dict:
			out_dict[c] = 1
		else:
			out_dict[c] += 1
	return out_dict


def findTheDifference(s: str, t: str) -> str:
	s_dict = makeDict(s)
	t_dict = makeDict(t)
	diff_list = list(set(t_dict.keys()) - set(s_dict.keys()))
	if len(diff_list) > 0:
		return diff_list[0]
	
	t_list = sorted(t_dict.items(), key=lambda x:x[0])
	s_list = sorted(s_dict.items(), key=lambda x:x[0])

	for e_t, e_s in zip(t_list, s_list):
		t_count = e_t[1]
		s_count = e_s[1]
		if t_count != s_count:
			return e_t[0]
	return ''

# Test cases
print(findTheDifference("abcd", "abcde")) # Expect: "e"
print(findTheDifference("", "y")) # Expect: "y"
print(findTheDifference("a", "aa"))  # Expect: "a"
a = ""
b = ""
print(findTheDifference(a, b)) # Expect: "t"